import React from "react";
import {makeStyles} from "@material-ui/core/styles";

const products = [
    {
        name: 'Product 1',
        description: '',
        price: '',
        img: '',
    },
    {
        name: 'Product 2',
        description: '',
        price: '',
        img: '',
    },
    {
        name: '',
        description: 'Product 3',
        price: '',
        img: '',
    }
]

const useStyles = makeStyles({
    root: {
        maxWidth: 345,
    },
    media: {
        height: 140,
    },
});

export default () => {
    const classes = useStyles();
    return (
        <div>
            {
                products.map((product, index)=> {
                    return <span>{product.name}</span>
                })
            }
        </div>
    )
}
